// Projects.js
import React, { useState } from 'react';
import './projects.css';
import Navbar from './Navbar';

const Projects = () => {
  const [activeSection, setActiveSection] = useState(null);
  const [lightboxImage, setLightboxImage] = useState(null);

  const handleArrowClick = (section) => {
    setActiveSection(section);
    document.body.style.overflow = 'hidden';
  };

  const handleBackClick = () => {
    setActiveSection(null);
    document.body.style.overflow = 'auto';
  };

  const handleImageClick = (src) => {
    setLightboxImage(src);
  };

  const closeLightbox = () => {
    setLightboxImage(null);
  };

  const images = {
    anymodel: [
      "/anymodelpic1.png",
      "/anymodelpic2.png",
      "/anymodelpic3.png",
      "/anymodelpic4.png"
    ],
    project2: [
      "/deliverypic1.png",
      "/deliverypic2.png",
      "/deliverypic3.png",
      "/deliverypic4.png",
    ],
    project3: [
      "https://via.placeholder.com/600"
    ]
  };

  return (
    <div className="projects-container">
      <Navbar />
      <div className="hero" style={{ backgroundImage: 'url(/projectshero.png)' }}>
        <h1>Projects</h1>
      </div>
      <div className="project-sections">
        {activeSection === null ? (
          <>
            {/* Project 1 */}
            <div className="project-section">
              <div className="section-header">
                <h2>AnyModel Project</h2>
                <span className="arrow" onClick={() => handleArrowClick('anymodel')}>&#9654;</span>
              </div>
              {/* Project 1 details */}
            </div>

            {/* Project 2 */}
            <div className="project-section">
              <div className="section-header">
                <h2>Delivery App Project</h2>
                <span className="arrow" onClick={() => handleArrowClick('project2')}>&#9654;</span>
              </div>
              {/* Project 2 details */}
            </div>

            {/* Project 3 */}
            <div className="project-section">
              <div className="section-header">
                <h2>Project Title 3</h2>
                <span className="arrow" onClick={() => handleArrowClick('project3')}>&#9654;</span>
              </div>
              <p>
                Description for project 3. This project includes machine learning and AI model training.
              </p>
            </div>
          </>
        ) : (
          <div className="popup">
            <button className="back-button" onClick={handleBackClick}>Back</button>
            <div className={`popup-images ${activeSection}`}>
              {activeSection === 'project3' && (
                <div className="project-buttons">
                  <a href="/public/LispUnixKernel.docx" download>
                    <button className="download-button">Download Document</button>
                  </a>
                  <a href="https://github.com/Keefereeves1/Lisp-Unix-Like-Kernel" target="_blank" rel="noopener noreferrer">
                    <button className="github-button">
                      <img src="github-logo.png" alt="GitHub Logo" className="github-logo" />
                      GitHub Repository
                    </button>
                  </a>
                </div>
              )}
              {/* Images or content for the popup */}
            </div>
          </div>
        )}
        {lightboxImage && (
          <div className="lightbox" onClick={closeLightbox}>
            <img src={lightboxImage} alt="Enlarged view" className="lightbox-image" />
          </div>
        )}
      </div>
    </div>
  );
};

export default Projects;
